import './hero.css'
export const Hero = () => {
  return (
    <div className='hero'>
      <div><span>Ready to test your <b>hacking</b> skills ? </span>
        <p></p>
      </div>
      <div><p>Cameroons National Hackings Days</p></div>
    </div>
  )
}

export default Hero
